import React from 'react';

const MobileList = ({ items }) => {
  return (
    <div className="mobile-list">
      {items.map(item => (
        <div key={item.id}>
          <img src={item.src} alt={item.title} />
          <h4>{item.title}</h4>
          <p>{item.date}</p>
        </div>
      ))}
    </div>
  );
};

export default MobileList;
